import React from 'react';
import s from './Post.module.css';
import user from '../../../../assets'

const Post = (props) => {
  return (
    <div className={s.item}>
      <img src={user.png} />
        { props.message }
          <div>
        <span>like</span> { props.likesCount }
      </div>
    </div>
  )
}

export default Post;
